function Nav(){
    return(
        <div className='navbar'>

          <ul className='navbar__menu'>
            <li className='navbar__links'>Projects</li>
            <li className='navbar__links'>Services</li>
            <li className='navbar__links'>About Us</li>
            </ul>  

        </div>

    )
}

export default Nav;
